import React from 'react';

const Item = () => {


    let i = item.map((item) =>{
    
        return (
            
       
       <div className='items_blok' >
       <img src={item.img} alt="" />
       <p className='item_blog_data'>{item.data}</p>
       <p className='item_blog_name'>{item.name}</p>
       <hr className="item_line" />
       <NavLink   to="/item"  > <button  className="item_btn">Читати &#8594;</button></NavLink>
       <Item order={item.name} />
       </div>
       
        )
    })
    return (
        <div>
           <div>
            {i}
           </div>
        </div>
    );
};

export default Item;
